    false,nt"url": null,nt"notes": "Hillside National Wildlife Refuge was visited
    July 15-17, 1985 for the purpose of sampling the one-acre borrow ditches along the
    west side of the refuge. As in the past, buffalo and carp dominate the fishery and
    yet a good population of bass and catfish is also present. Plans to allow commercial
    netting were discussed with the refuge manager and staff. Results from the complete
    eradication of fish from two ponds using liquid rotenone follow. Fish were gathered
    the day of rotenone application and the following day.",nt"license_title":
